import axios from "axios"
import LoginComponent from "../../components/todo/LoginComponent"
import {API_URL, JPA_API_URL} from '../../Constants'
import GeocodingService from '../map/GeocodingService.js'


class TodoDataService{
    retrieveAllTodos(name) {
        return axios.get(`${JPA_API_URL}/users/${name}/todos`)
    }

    retrieveTodo(name, id) {
        return axios.get(`${JPA_API_URL}/users/${name}/todos/${id}`)
    }

    deleteTodo(name, id){
        return axios.delete(`${JPA_API_URL}/users/${name}/todos/${id}`)
    }

    updateTodo(name, id, todo){
        console.log("sending request to geocoding service")
        GeocodingService
        .geocoding(todo.place)

        return axios.put(`${JPA_API_URL}/users/${name}/todos/${id}`, todo)
    }

    createTodo(name, todo){
        console.log("sending request to geocoding service")
        GeocodingService.geocoding(todo.place)
        return axios.post(`${JPA_API_URL}/users/${name}/todos`, todo)
    }



}

export default new TodoDataService()
